type StringMap map[string]string
type OnRequestEnd func(headers map[string][]string, cookies []*http.Cookie)
type OnHttpClient func(proxyAddr, local_port string) *http.Client

type HClient struct {
	ProxyAddr, LocalPort string
}

func (hc *HClient) NewHttpClient(proxyAddr, local_port string) *http.Client {
	pinfo := fmt.Sprintf(proxyAddr, local_port)
	proxy, err := url.Parse(pinfo)
	if err != nil {
		return nil
	}
	netTransport := &http.Transport{
		Proxy: http.ProxyURL(proxy),
		Dial: func(netw, addr string) (net.Conn, error) {
			c, err := net.DialTimeout(netw, addr, time.Second*time.Duration(10))
			if err != nil {
				return nil, err
			}
			return c, nil
		},
		MaxIdleConnsPerHost:   10,                              //每个host最大空闲连接
		ResponseHeaderTimeout: time.Second * time.Duration(10), //数据收发5秒超时
	}
	return &http.Client{
		Timeout:   time.Second * 10,
		Transport: netTransport,
	}
}

func (hc *HClient) NewClient() *http.Client {
	return hc.NewHttpClient(hc.ProxyAddr, hc.LocalPort)
}

type Ctx struct {
	Isdebug      bool
	ProxyAddr    string
	LocalPort    string
	Headers      *map[string]string
	Cookies      *map[string]string
	OnRequestEnd OnRequestEnd
	OnHttpClient *HClient
}

func (t *Ctx) common_headers() map[string]string {
	if t.Headers != nil {
		return *t.Headers
	} else {
		return nil
	}
}
func (t *Ctx) build_cookies() map[string]string {
	if t.Cookies != nil {
		return *t.Cookies
	} else {
		return nil
	}
}

func (t *Ctx) Get(url string) string {
	return t.Get2(url, "")
}
func (t *Ctx) Get2(url string, data string) string {
	return t.Get4(url, data, make(map[string]string), make(map[string]string))
}

func (t *Ctx) Get4(url string, data string, cks map[string]string, hds map[string]string) string {
	if t.Isdebug {
		println("Get url", url)
	}
	var client *http.Client = nil
	if t.OnHttpClient == nil {
		client = &http.Client{Timeout: 10 * time.Second}
	} else {
		client = t.OnHttpClient.NewClient()
	}
	var req *http.Request
	if data == "" {
		req, _ = http.NewRequest(http.MethodGet, url, nil)
	} else {
		req, _ = http.NewRequest(http.MethodGet, url, strings.NewReader(data))
	}

	cookies := t.build_cookies()
	if cookies != nil {
		for k, v := range cookies {
			if t.Isdebug {
				println("add cookie", k, v)
			}
			req.AddCookie(&http.Cookie{Name: k, Value: v, HttpOnly: true})
		}
	}
	for k, v := range cks {
		if t.Isdebug {
			println("add cookie", k, v)
		}
		req.AddCookie(&http.Cookie{Name: k, Value: v, HttpOnly: true})
	}
	headers := t.common_headers()
	if headers != nil {
		for k, v := range headers {
			if t.Isdebug {
				println("add header", k, v)
			}
			req.Header.Add(k, v)
		}
	}
	for k, v := range hds {
		if t.Isdebug {
			println("add header", k, v)
		}
		req.Header.Add(k, v)
	}
	resp, err := client.Do(req)
	if err != nil {
		println(err)
		return ""
	}
	defer resp.Body.Close()

	if t.OnRequestEnd != nil {
		cookies := resp.Cookies()
		t.OnRequestEnd(resp.Header, cookies)
	}

	var buffer [512]byte
	result := bytes.NewBuffer(nil)
	for {
		n, err := resp.Body.Read(buffer[0:])
		result.Write(buffer[0:n])
		if err != nil && err == io.EOF {
			break
		} else if err != nil {
			return ""
		}
	}
	return result.String()
}

