func intRange(min, max int) int {
	var result int
	switch {
	case min > max:
		panic("MinMaxError")
	case max == min:
		result = max
	case max > min:
		maxRand := max - min
		b, err := rand.Int(rand.Reader, big.NewInt(int64(maxRand)))
		if err != nil {
			panic(err)
		}
		result = min + int(b.Int64())
	}
	return result
}

func choiceIndex(array interface{}) int {
	arr := reflect.ValueOf(array)
	return intRange(0, arr.Len())
}

func choice(array interface{}) interface{} {
	arr := reflect.ValueOf(array)
	return arr.Index(choiceIndex(array)).Interface()
}

func RandUserAgentAndroid() string {
	var chrome_version string = choice(_CHROME_VERSIONS).(string)
	var machine Machine = choice(_MODEL_BUILDS).(Machine)
	var version string = choice(_MODEL_VERSION).(string)
	var parts []string = []string{"Mozilla/5.0 (Linux; Android ", version, "; ", machine.Model, " Build/", machine.Build, ") AppleWebKit/537.36 (KHTML, like Gecko) Chrome/", chrome_version, " Mobile Safari/537.36"}
	return strings.Join(parts, "")
}

