func Md5V(str string) string {
	h := md5.New()
	h.Write([]byte(str))
	return hex.EncodeToString(h.Sum(nil))
}

func B64(msg string) string {
	return base64.URLEncoding.EncodeToString([]byte(msg))
}

func xml2map(str string) map[string]string {
	dataMap := make(map[string]string)
	err := xml.Unmarshal([]byte(str), (*StringMap)(&dataMap))
	if err != nil {
		println("parse xml error")
	}
	return dataMap
}

func J2map(str string) map[string]string {
	dataMap := make(map[string]string)
	err := json.Unmarshal([]byte(str), (*StringMap)(&dataMap))
	if err != nil {
		println("parse json error", err)
	}
	return dataMap
}

func X2map(body string) map[string]string {
	if body != "" && strings.Contains(body, "<response>") {
		start_index := strings.Index(body, "<response>")
		response_str := body[start_index:]
		return xml2map(response_str)
	} else if body != "" && strings.Contains(body, `<?xml version="1.0" encoding="UTF-8"?>`) {
		start_index := strings.Index(body, `<?xml version="1.0" encoding="UTF-8"?>`) + len(`<?xml version="1.0" encoding="UTF-8"?>`) + 1
		response_str := body[start_index:]
		return xml2map(response_str)
	} else if body != "" {
		return xml2map(body)
	}
	return nil
}

func Appendfile(path, str_content string) {
	fd, err := os.OpenFile(path, os.O_RDWR|os.O_CREATE|os.O_APPEND, 0644)
	if err != nil {
		println("open file fail....", err)
	}
	defer fd.Close()
	buf := []byte(fmt.Sprintf("%s\r\n", str_content))
	fd.Write(buf)
}

func Random_pwd(slen int) string {
	sa := make([]string, slen)
	for i := 0; i < slen; i++ {
		sa[i] = choice(_RANDSEED).(string)
	}
	return strings.Join(Random(sa), "")
}

